    "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.": {"en": "Ideally, inquiries should be made in English because some developers come from abroad and are not proficient in the local language.", "de": "Idealerweise sollten Anfragen auf Englisch gestellt werden, denn einige Entwickler kommen aus dem Ausland und sind der Landessprache nicht mächtig.", "ru": "В идеале запросы следует направлять на английском языке, поскольку некоторые разработчики приезжают из-за границы и не владеют местным языком.", "pt": "Idealmente, as consultas devem ser feitas em inglês porque alguns desenvolvedores vêm do exterior e não são proficientes no idioma local.", "nl": "Idealiter moeten vragen in het Engels worden gesteld omdat sommige ontwikkelaars uit het buitenland komen en niet bekwaam zijn in de lokale taal.", "fr": "Dans l’idéal, les demandes de renseignements devraient être adressées à l’anglais, car certains développeurs viennent de l’étranger et ne maîtrisent pas la langue locale.", "it": "L'ideale è fare le richieste di informazioni in inglese, in quanto alcuni sviluppatori provengono dall'estero e non hanno una buona conoscenza della lingua locale.", "es": "Lo ideal es que las consultas se realicen en inglés porque algunos desarrolladores provienen del extranjero y no son competentes en el idioma local.", "pl": "W idealnym przypadku zapytania powinny być kierowane w języku angielskim, ponieważ niektórzy programiści pochodzą z zagranicy i nie znają języka lokalnego.", "uk": "В ідеалі запити слід робити англійською, оскільки деякі розробники приїжджають з-за кордону і не володіють місцевою мовою.", "zh-cn": "理想情况下，查询应该用英语进行，因为有些开发人员来自国外，并且不熟悉当地语言。"},
    "If links are missing or wrong, please send us an e-mail to": {"en": "If links are missing or wrong, please send us an e-mail to", "de": "Wenn Links fehlen oder falsch sind, senden Sie uns bitte eine E-Mail an", "ru": "Если ссылки отсутствуют или неправильны, пожалуйста, отправьте нам письмо по электронной почте", "pt": "Se os links estão faltando ou errado, por favor envie-nos um e-mail para", "nl": "Als links ontbreken of verkeerd zijn, stuur ons een e-mail naar", "fr": "Si des liens manquent ou sont incorrects, veuillez nous envoyer un courrier électronique à", "it": "Se ci sono link mancanti o errati, inviaci una e-mail a", "es": "Si faltan enlaces o están equivocados, envíenos un correo electrónico a", "pl": "Jeśli brakuje linków lub są one nieprawidłowe, wyślij nam e-mail na adres", "uk": "Якщо посилання відсутні або неправильні, надішліть нам електронний лист на адресу", "zh-cn": "如果链接丢失或错误，请发送电子邮件至"},
