    "only for experts": {                             "en": "Attention !! These adapters may be in a very early stage and it is not recommended to install them in a production system.", "de": "Achtung!! Diese Adapter können sich in einem sehr frühen Stadium befinden und es wird davon abgeraten, diese in einem Produktivsystem zu installieren.", "ru": "Внимание!! Эти адаптеры могут находиться на очень ранней стадии и не рекомендуется устанавливать в производственной системе.", "pt": "Atenção!! Esses adaptadores podem estar em um estágio inicial e não devem ser instalados em um sistema produtivo.", "nl": "LetOp !! Deze adapters bevinden zich mogelijk in een zeer vroeg stadium en worden niet aanbevolen voor installatie in een productiesysteem.", "fr": "Attention!! Ces adaptateurs peuvent être à un stade très précoce et leur installation dans un système de production n'est pas recommandée.", "it": "Attenzione!! Questi adattatori potrebbero essere in una fase iniziale, per tanto è sconsigliabile installarli in un sistema di produzione.", "es": "Atención!! Estos adaptadores pueden estar en una etapa muy temprana y no se recomienda instalarlos en un sistema de producción.", "pl": "Uwaga!! Adaptery te mogą znajdować się na bardzo wczesnym etapie i nie zaleca się instalowania ich w systemie produkcyjnym.", "uk": "Увага!! Ці адаптери можуть бути на дуже ранній стадії, тому не рекомендується встановлювати їх у робочій системі.", "zh-cn": "注意!!这些适配器可能处于非常早期阶段，建议不要将它们安装在生产系统中。"},
